    data: |
      SELECT * FROM tab0 (FORMAT parquet) AS cor0 WHERE - 75 * - col1 + col2 + - 55 NOT BETWEEN - + col0 + - + col0 / 59 * + - col1 AND + + col2;
  - name: tab0

outputs:
  - name: q5651.out
    data: |
      15	81	47
      87	21	10
      97	1	99
